import React from 'react';
import './ContactForm.css';

function ContactForm() {
  return (
        <div className="bg-contact2 contact">
            <div className="container-contact2">
                <div className="wrap-contact2">
                </div>
            </div>
        </div>
    );
}

export default ContactForm;
